import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter,Route,Link} from "react-router-dom";
import LogHeader from './loginpg/logHeader';
import LogMainbody from "./loginpg/logMainbody";
import SignupMainbody from "./signuppg/signupMainbody";
import SignupHeader from "./signuppg/signupHeader";
import WelHeader from "./welcompg/welHeader";
import WelMainbody from "./welcompg/welMainbody";
import App from "./App"
const routing = (
    <BrowserRouter>
        <div>

            <div className="navbar-nav ml-auto">
                <Link className="nav-item nav-link">Login</Link>
                <Link className="nav-item nav-link" >Signup</Link>
            </div>
            <Route exact path="/" component={App} />
            <Route path="/login" component={WelHeader} />
            <Route path="/signup" component={WelHeader} />
        </div>
    </BrowserRouter>
)



ReactDOM.render(routing, document.getElementById('root'));
